import React, { useState } from 'react';

const Counter = () => {
  const [count, setCount] = useState(0);

function increment(){
    setCount(count + 1);
}
function decrement(){
    setCount(count - 1);
}

  return (
    <div>
      <p>Count: {count}</p>
      <button onClick={increment}>Increment</button>
      <br /><button onClick={decrement}>Increment</button>
    </div>
  );
};

export default Counter;
